import React, { useState } from 'react';
import { ADDRECIPE_ROUTE } from '../utils/consts';
import { useHistory } from 'react-router-dom';
import {Button, Container} from "react-bootstrap"
import CreateRecipe from '../modals/CreateRecipe';

const Cabinet = () => {
    const history = useHistory()
    const [recipeVisible, setRecipeVisible] = useState(false)
        return (          
        <Container>
            <Button variant={"outline-dark"} className="ml-2" onClick={() => setRecipeVisible(true)}>Добавить рецепт</Button>
            <CreateRecipe show={recipeVisible} onHise={()=> setRecipeVisible(false)}/>
        </Container>
        );
    
};

export default Cabinet;
